INSERT INTO `work` (`id`, `name`, `size`, `property`, `profession`, `title`, `description`, `treatment`, `education`, `life`, `number`, `contact`, `area_id`, `area_name`, `address`, `type_zid`, `type_fid`, `position1`, `position2`, `creattime`, `jd`, `uid`, `map_x`, `map_y`) VALUES
	(1, '四季青投资有限公司1', '1-491', 2, '金融/银行1', '高薪诚聘销售代表1', '岗位职责：开发市场，拓展市场，按照企业计划和程序开展产品推广活动，介绍产品并提供相应资料；建立客户资料卡及客户档案，完成相关销售报表； 参加公司召开的销售会议或组织的培训11', '2000-30001', '不限1', '不限 ,可接收应届生1', 51, '80633581111', 3, '海港区', '白塔岭1', 23, 1, '1', '2', '1392129000', '11111', 1, NULL, NULL),
	(2, '湖南摩尔多瓦葡萄酒业有限公司', '100-499', 3, '批发/零售+快速消费品(食品/饮料等)', '销售代表', '任职资格：要求身高162以上，形象气质佳，善于交际，处事灵活，懂社交礼仪\r\n\r\n工作时间：早八点半，晚五点。\r\n\r\n底薪2000+高额奖金提成。', '2000-3000', '中专 ', '3-5年', 2, '15076044205', 4, '海港区', '白塔岭', 23, 1, '1', '2', NULL, NULL, 1, NULL, NULL),
	(3, '郑州卡驰商贸有限公司', '100-499', 3, '互联网/电子商务', '销售代表', '本公司新开发的手机节费宝，现面向全国招商：\r\n白天打全国电话8分钱/分钟， 晚上免费打 。移动 、联通 、电信均可使用，不换卡，不换号，无最低消费。一台电脑一部电话就是办公设备，无', '面议', '不限', '不限', 3, '13140061880', 5, '北戴河区', '南戴河', 23, 1, '1', '1', NULL, NULL, 1, NULL, NULL),
	(4, '秦皇岛卫军商贸有限公司', '1-49', 2, '快速消费品(食品/饮料等)', '销售代表', '岗位职责：1，负责秦皇岛地区泸州老窖定制酒的推广宣传及销售工作\r\n          2，根据市场营销计划，完成部门指标\r\n          3，开发新客户，大产品销售范围\r\n          4，负责销售区域内销售活', '1000-2000', '高中', '1-2年', 5, '18332577887', 6, '北戴河区', '北岭', 23, 1, '1', '4', NULL, NULL, 1, NULL, NULL),
	(6, '秦皇岛海港区迂辖谈院状亚公司 ', '50-99', 2, '互联网/电子商务+计算机软件+计算机硬件', '急急急招网络销售', '必须能够方便上网，计件工资，多劳多得 。\r\n\r\n工薪待遇，一个任务一结算!\r\n\r\n按任务比例获取佣金的，按本金13%提成！ 保证薪资 200-300/天\r\n\r\n不受学历限制.不需任何专业技能.不需任何工作经验', '5000-8000', '不限', '不限 ,可接收应届生 ', 12, '', 7, '山海关区', '南门', 23, 2, '1', '3', NULL, NULL, 1, NULL, NULL),
	(7, '秦皇岛八方凯信物业服务有限公司', '100-499', 2, '其他行业', '昌黎物业客服员', '女性，22-30岁，良好的沟通能力及较强的抗压能力，稳重心细，学会计专业或有物业行业收费经验的优先录取。', '1000-2000', '高中 ', '1-2年', 1, '18233517971', 1, '昌黎县', '', 27, 20, '1', '2', NULL, NULL, 1, NULL, NULL),
	(8, '八方凯信物业', '500-999', 2, '房地产/物业管理+环保+其他行业', '八方凯信物业招聘保安客服', '招聘客服员；有经验者优先；年龄18-35岁、塌实肯干、认真负责、有较强的工作能力。工资1800-2100\r\n招聘保洁员；保底1700+奖金\r\n招聘保安；形象岗男女不限20-35岁巡逻岗55岁左右经过录用待遇优厚', '2000-3000（季度绩效，最高为岗位季度工资的12%）', '高中 ', '不限 ', 300, '15233519191', 2, '抚宁县', NULL, 27, 21, '1', '4', NULL, NULL, 1, NULL, NULL),
	(10, '微讯信息技术3333', '3', 2, '服务行业', '高薪聘请服务总监', '&lt;p&gt;\r\n &lt;img src=&quot;http://192.168.1.118/ptgx/frontendcore/plugs/kindeditor/plugins/emoticons/images/28.gif&quot; alt=&quot;&quot; border=&quot;0&quot; /&gt;\r\n&lt;/p&gt;', '2000', '本科', '应届生', 3, '8888337', 3, '山海关区', '经济技术开发区', 23, 2, '1', '1', '1388108869', '西环北路56号', 1, NULL, NULL),
	(11, '公司名称', '11', 1, '5464', '职位标题', '职位描述', '20000', '本科', '1', 2, '654654', 4, NULL, '地址', 2033, 1, '1', '2', '1392000991', '街道地址', 1, NULL, NULL),
	(14, '微讯', '50', 1, 'IT', '程序员', '职务描述', '3333', '本', '2', 2, '3294789324', 1, '海港区', '的萨芬的飞', NULL, NULL, '1', '2', '1392124144', '盛大方法', 1, NULL, NULL),
	(16, '你好lll', '55', 1, '46546', '你好吗', '你好吗hhhh', '500', '本', '5', 2, '465464', 1, NULL, '4654654', NULL, NULL, '1', '', '1405414335', '65465456', 1, NULL, NULL),
